import React from 'react'
import { useState } from 'react'
import signlogo from '../components/images/signuplogo.jpg'
import { NavLink, useNavigate } from 'react-router-dom'

const Signup = () => {
  const navigate = useNavigate();

  const [user, setUser] = useState({
    name:"", email:"", phone:"", work:"", password:"", confirmPassword:""
  });

  let name, value;
  const handleInputs = (e) => {
    console.log(e);
    name = e.target.name;
    value = e.target.value;

    setUser({...user, [name]: value});
  }

  const PostData = async (e) =>{
    e.preventDefault();

    const { name, email, phone, work, password, confirmPassword } = user;

    const res = await fetch("/register", {
      method: "POST",
      headers: {
        "Content-Type" : "application/json"
      },
      body: JSON.stringify({
        name, email, phone, work, password, confirmPassword
      })
    });
    const data = await res.json();
    console.log(data);

    if(data.status === 422 || !data){
      window.alert("inValid Registration");
      console.log("inValid Registration");
    }
    else{
      window.alert("Registration Successfull");
      console.log("Registration Successfull");

      navigate("/Login");
    }
    // if(data.success){
    //   window.alert("Registration Successfull");
    //   console.log("Registration Successfull");

    //   navigate("/Login");
    // }
    // else{
    //   window.alert("inValid Registration");
    //   console.log("inValid Registration");
    // }

  }

  return (
    <>

        <section className='signup'>
          <div className='container mt-5'>
            <div className='signup-content'>
              <div className='signup-form'>
                <h2 className='form-title'> Sign Up</h2>
                <form method="POST" className='registration-form' id='registration-form'>
                  <div className='form_group'>
                    <label htmlFor='name'>
                      <i className="zmdi zmdi-account-add"></i>
                    </label>
                    <input type='text' id='name' name='name' autoComplete='off'
                    value={user.name}
                    onChange={handleInputs}
                     placeholder='Enter your name'></input>
                  </div>

                  <div className='form_group'>
                    <label htmlFor='email'>
                    <i className="zmdi zmdi-email"></i>
                    </label>
                    <input type='email' id='email' name='email' autoComplete='off'
                    value={user.email}
                    onChange={handleInputs}
                     placeholder='Enter your email'></input>
                  </div>

                  <div className='form_group'>
                    <label htmlFor='phone'>
                    <i className="zmdi zmdi-phone-in-talk"></i>
                    </label>
                    <input type='number' id='phone' name='phone' autoComplete='off'
                    value={user.phone}
                    onChange={handleInputs}
                     placeholder='Enter your phone no'></input>
                  </div>

                  <div className='form_group'>
                    <label htmlFor='work'>
                    <i className="zmdi zmdi-book"></i>
                    </label>
                    <input type='text' id='work' name='work' autoComplete='off' 
                    value={user.work}
                    onChange={handleInputs}
                    placeholder='Your profession'></input>
                  </div>

                  <div className='form_group'>
                    <label htmlFor='password'>                      
                      <i className="zmdi zmdi-lock-outline"></i>
                    </label>
                    <input type='password' id='password' name='password' autoComplete='off'
                    value={user.password}
                    onChange={handleInputs}
                     placeholder='Enter your password'></input>
                  </div>

                  <div className='form_group'>
                    <label htmlFor='confirmPassword'>
                    <i className="zmdi zmdi-lock"></i>
                    </label>
                    <input type='confirmPassword' id='confirmPassword' name='confirmPassword' autoComplete='off' 
                    value={user.confirmPassword}
                    onChange={handleInputs}
                    placeholder='Confirm your password'></input>

                  </div>

                  <div className='form-group form-button '>
                    <input type='submit' name='signup' id='signup' className='form-submit' value = 'Register' onClick={PostData}></input>
                  </div>
                </form>
              </div>

              <div className='signup-image'>
                <figure>
                <img src= {signlogo} alt= 'registration pic'/>
                </figure>
                <NavLink to = '/Login' className = 'signup-image-link'> Already Registered</NavLink>
              </div>
            </div>

          </div>

        </section>
    </>
  )
}

export default App
